/**
 * Following functions are part of Formula.js only and not found in Excel.
 * Purpose of these functions is to implement an Excel like behaviour for fundamental math symbols such as +, -, /, *, etc.
 */
/**
 * Formula.js only.
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function ADD(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} dividend
 * @param {*} divisor
 * @returns
 */
export function DIVIDE(dividend: any, divisor: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} value1
 * @param {*} value2
 * @returns
 */
export function EQ(value1: any, value2: any, ...args: any[]): boolean | Error;
/**
 * Formula.js only
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function GT(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function GTE(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function LT(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function LTE(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} num1
 * @param {*} num2
 * @returns
 */
export function MINUS(num1: any, num2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} factor1
 * @param {*} factor2
 * @returns
 */
export function MULTIPLY(factor1: any, factor2: any, ...args: any[]): any;
/**
 * Formula.js only
 *
 * @param {*} value1
 * @param {*} value2
 * @returns
 */
export function NE(value1: any, value2: any, ...args: any[]): boolean | Error;
/**
 * Formula.js only
 *
 * @param {*} base
 * @param {*} exponent
 * @returns
 */
export function POW(base: any, exponent: any, ...args: any[]): any;
